import configConstants from '@config/constants'

const {
  API: { baseURL, timeout }
} = configConstants

const params = {}

const hhh = Object.entries(params)
  .map((arr) => `${arr[0]}=${arr[1]}`)
  .toString()
  .replaceAll(',', '&')

const URL = `${baseURL}/${'route'}${Object.keys(params).length > 0 ? '?' : 0}${hhh}`

const buuks = 'hello'

console.log('buukss', URL)

export default buuks
